import React, { useState, useEffect } from 'react';

function ViewMyPackages() {
  const [packages, setPackages] = useState([]); // Stocăm pachetele
  const [error, setError] = useState(false);   // Stocăm starea erorii

  useEffect(() => {
    console.log('Fetching packages...');
    fetch('http://localhost:3000/packages') // Schimbă URL-ul dacă endpoint-ul e diferit
      .then((response) => {
        console.log('Response status:', response.status);
        if (!response.ok) {
          throw new Error('Failed to fetch');
        }
        return response.json();
      })
      .then((data) => {
        console.log('Data received:', data);
        setPackages(data);
      })
      .catch((err) => {
        console.error('Fetch error:', err);
        setError(true);
      });
  }, []);

  console.log('Packages state:', packages);

  // În caz de eroare
  if (error) {
    return <p>Failed to fetch packages. Please try again later.</p>;
  }

  // Dacă nu sunt pachete
  if (packages.length === 0) {
    return <p>No packages available.</p>;
  }

  // Dacă sunt pachete disponibile
  return (
    <div>
      <h2>My Packages</h2>
      <ul>
        {packages.map((pkg) => (
          <li key={pkg.id}>{pkg.name}</li>
        ))}
      </ul>
    </div>
  );
}

export default ViewMyPackages;
